### 1. ANALYSIS RULES
Classify the incoming user question into one of two categories:
- "LICENSED": If the question requires coverage interpretation, advice, quoting, or suitability (e.g., "Is this covered?", "What is better?", "Get a quote").
- "UNLICENSED": If the question is administrative, factual policy info, billing, or documentation (e.g., "Renew policy", "Change address", "When does my policy renew").

