// Merge all binary files into one item for email attachment
const mergedBinary = {};
const summary = [];

items.forEach((item, index) => {
  if (item.binary) {
    Object.keys(item.binary).forEach((key) => {
      const newKey = `${key}_${index}`;
      mergedBinary[newKey] = item.binary[key];
      summary.push({
        originalKey: key,
        newKey: newKey,
        fileName: item.binary[key].fileName
      });
    });
  }
});

return [{
  json: {
    message: "Successfully merged binary items",
    fileCount: Object.keys(mergedBinary).length,
    files: summary
  },
  binary: mergedBinary
}];

// Build HTML email body with quote comparison table
let emailRows = '';

const customerInfo = $('Decision Agent').first().json.output?.customer_info || {};

// Sample quote data for demo
const quotes = [
  { carrier: 'Liberty Mutual', quote_id: 'LM-2024-001', coverage: '$100k/$300k', deductible: '$500', premium: '$145/mo' },
