  { carrier: 'Travelers', quote_id: 'TRV-2024-003', coverage: '$100k/$300k', deductible: '$750', premium: '$125/mo' }
];

quotes.forEach((quote, index) => {
  emailRows += `
    <tr>
      <td style="padding: 12px; border-bottom: 1px solid #eeeeee;">
        <strong>${quote.carrier}</strong>
        ${index === 2 ? '<br><span style="color: green; font-weight: bold; font-size: 10px;">â˜… RECOMMENDED</span>' : ''}
      </td>
      <td style="padding: 12px; border-bottom: 1px solid #eeeeee;">${quote.quote_id}</td>
      <td style="padding: 12px; border-bottom: 1px solid #eeeeee;">${quote.coverage}</td>
      <td style="padding: 12px; border-bottom: 1px solid #eeeeee;">${quote.deductible}</td>
      <td style="padding: 12px; border-bottom: 1px solid #eeeeee; font-weight: bold;">${quote.premium}</td>
    </tr>
  `;
});

const emailHtml = `
<div style="font-family: Arial, sans-serif; color: #333; max-width: 600px; margin: 0 auto;">
  <h2 style="color: #0077b6;">Insurance Quote Comparison</h2>
  <p>Dear ${customerInfo.customer_name || 'Valued Customer'},</p>
  <p>Based on your request, we have gathered the following quotes for your review:</p>

  <table width="100%" border="0" cellspacing="0" cellpadding="0" style="margin: 20px 0;">
    <thead style="background-color: #f8f9fa;">
      <tr>
        <th style="padding: 12px; text-align: left; border-bottom: 2px solid #dee2e6;">Provider</th>
        <th style="padding: 12px; text-align: left; border-bottom: 2px solid #dee2e6;">Quote ID</th>
        <th style="padding: 12px; text-align: left; border-bottom: 2px solid #dee2e6;">Coverage</th>
        <th style="padding: 12px; text-align: left; border-bottom: 2px solid #dee2e6;">Deductible</th>
        <th style="padding: 12px; text-align: left; border-bottom: 2px solid #dee2e6;">Premium</th>
      </tr>
    </thead>
    <tbody>
      ${emailRows}
    </tbody>
  </table>

  <p>Please review the attached quote documents for complete details.</p>
  <p>If you have any questions, please reply to this email or call us at 1-800-ACRISURE.</p>
  <p>Best regards,<br><strong>Acrisure Insurance Team</strong></p>
</div>
`;

return [{
  json: {
    subject: `Insurance Quotes for ${customerInfo.customer_name || 'Customer'} - Policy ${customerInfo.policy_number || 'N/A'}`,
    html_body: emailHtml,
    to_email: customerInfo.email || 'customer@email.com'
  }
}];
